import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
// import { Router, Switch, Route } from 'react-router-dom';
import Header from './Header';
import Home from '../pages/Home';
import Movies from '../pages/Movies';
import TVshows from '../pages/Tvshows';
import Favorite from '../pages/Favorite';
import Detail from '../pages/Detail';
import Search from '../pages/Search';
import Action from './movies/genre/Action';
import Adventure from './movies/genre/Adventure';
import Animation from './movies/genre/Animation';
import Comedy from './movies/genre/Comedy';
import Documentary from './movies/genre/Documentary';
import Drama from './movies/genre/Drama';
import Fantasy from './movies/genre/Fantasy';
import Horror from './movies/genre/Horror';
import Romance from './movies/genre/Romance';
import Scifi from './movies/genre/Scifi';
import './App.css';

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/movies" exact component={Movies} />
        <Route path="/movies/action" component={Action} />
        <Route path="/movies/adventure" component={Adventure} />
        <Route path="/movies/animation" component={Animation} />
        <Route path="/movies/comedy" component={Comedy} />
        <Route path="/movies/documentary" component={Documentary} />
        <Route path="/movies/drama" component={Drama} />
        <Route path="/movies/fantasy" component={Fantasy} />
        <Route path="/movies/horror" component={Horror} />
        <Route path="/movies/romance" component={Romance} />
        <Route path="/movies/scifi" component={Scifi} />
        <Route path="/tvshows" component={TVshows} />
        <Route path="/favorite" component={Favorite} />
        {/* <Route path="/detail/:id" component={Detail} /> */}
        <Route path="/detail" component={Detail} />
        {/* <Route path="/search/:query" component={Search} /> */}
        <Route path="/search" component={Search} />
      </Switch>
    </BrowserRouter>
  );
};

export default App;

// Could be props
// genres, year, country, producer...
// Could be state
